void SelectionSort() {
    std::vector<int> arr = raw_arr;
    for (auto it = arr.begin(); it != arr.end() - 1; ++it) {
        std::iter_swap(it, std::min_element(it, arr.end()));
    }

    // Output

    for (auto num: arr) {
        std::cout << num << std::endl;
    }
}

void BubbleSort() {

    std::vector<int> arr = raw_arr;
    bool flag = true;
    while (flag) {
        flag = false;
        for (auto it = arr.begin(); it != arr.end() - 1; it ++) {
            if (*it > *(it + 1)) {
                flag = true;
                std::iter_swap(it, (it + 1));
            }
        }
    }

    // Output

    for (auto num: arr) {
        std::cout << num << std::endl;
    }
}

void InsertionSort() {
    std::vector<int> arr = raw_arr;
    for (std::size_t i = 0; i < arr.size(); i ++) {
        int tmp = arr[i];
        int j = i - 1;
        while((j >= 0) && (tmp < arr[j])) {
            arr[j + 1] = arr[j];
            j --;
        }
        arr[j + 1] = tmp;
    }

    // Output

    for (auto num: arr) {
        std::cout << num << std::endl;
    }
}

// Advanced Sort Algorithm

// lomuto
int lomutoPartition(std::vector<int>& arr, int low, int high) {
    int pivot = arr[high]; 
    int i = (low - 1); 

    for (int j = low; j <= high - 1; j++) {
        if (arr[j] <= pivot) {
            i++;
            std::swap(arr[i], arr[j]); 
        }
    }
    
    std::swap(arr[i + 1], arr[high]);
    
    return (i + 1);
}

void QuickSortLomuto(std::vector<int>& arr, int low, int high) {
    if (low < high) {
        int pi = lomutoPartition(arr, low, high);

        QuickSortLomuto(arr, low, pi - 1);
        
        QuickSortLomuto(arr, pi + 1, high);
    }
}

// hoare
int hoarePartition(std::vector<int>& arr, int low, int high) {
    int pivot = arr[low]; 
    
    int i = low - 1;
    int j = high + 1;

    while (true) {
        do {
            i++;
        } while (arr[i] < pivot);

        do {
            j--;
        } while (arr[j] > pivot);

        if (i >= j)
            return j;

        std::swap(arr[i], arr[j]);
    }
}

void QuickSortHoare(std::vector<int> arr = raw_arr, int low = 0, int high = 4999) {
    if (low < high) {
        int pi = hoarePartition(arr, low, high);

        QuickSortHoare(arr, low, pi);
        
        QuickSortHoare(arr, pi + 1, high);
    }
}

// OI WIKI

int Partition(std::vector<int>& A, int low, int high) {
    int pivot = A[low];
    while (low < high) {
        while (low < high && pivot <= A[high]) --high;
            A[low] = A[high];
        while (low < high && A[low] <= pivot) ++low;
            A[high] = A[low];
    }
    A[low] = pivot;
    return low;
}

void WikiQuickSort(std::vector<int>& A, int low, int high) {
    if (low < high) {
        int pivot = Partition(A, low, high);
        WikiQuickSort(A, low, pivot - 1);
        WikiQuickSort(A, pivot + 1, high);
    }
}

void WikiQuickSort() {
    auto arr = raw_arr;
    WikiQuickSort(arr, 0, arr.size() - 1);

    for (auto e : arr) {
        std::cout << e << std::endl;
    }
}

